import * as React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';

export default function Banner() {
  return (
    <Box
    position="absolute"
    color="default"
    elevation={0}
    sx={{
      position: 'relative',
      borderBottom: (t) => `3px solid ${t.palette.divider}`,
      height: '100rem',
    }}
    >
      <CardMedia
        component="img"
        width={120}
        height="140"
        src='https://images.unsplash.com/photo-1554034483-04fda0d3507b?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2670&q=80'
        alt="green iguana"
        />
    </Box>
  );
}
